import React from "react";
import axios from "axios";

function App() {
  const getQuote = () => {
    axios
      .get("https://www.fruityvice.com/api/fruit/all")
      .then((response) => {})
      .catch((error) => console.log(error));
  };

  return (
    <div className="App">
      <button onClick={getQuote}>Pegar Dados</button>
    </div>
  );
}

export default App;
